import './App.css';
import React from 'react';
import styled from 'styled-components'; 
import theme from './theme';
import './index.css';
import Nav from './Nav'


const {fonts} = theme;
const {colors} = theme;
function Admin() {

    const Container = styled.div`
        width: 100vw;
        background-color: ${colors.lightBeige};
        height: 80vw;
        display: flex;
        justify-content: center;

    `
    const Header = styled.div`
        font-size:3vw;
        color: ${colors.mocha};
        font-weight: 900;
        margin-bottom:2vw;
    `
    
    var isAdmin = false;
    

    return (
        <div>
            <Nav/>
            <Container>
                <script>
                    if (!isAdmin){
                        <Header>Enter Password</Header>
                    }
                    

                </script>

            </Container>

        </div>
    )


}

export default Admin;
